import React from 'react';

function Filter({handleInput,handleInput2, search, years, genres}){
    console.log(years);
    return(
        <div>
            <input type="text" placeholder="Search" onChange={handleInput} onKeyPress={search}/>

            <select onChange={handleInput2}>
                <option disabled selected hidden>Filter By</option>
                <option value="productionYear">Production Year</option>
                <option value="genre">Genre</option>
            </select>

            <select>
                <option disabled selected hidden>Value</option>
                {years.map((year)=>{
                    return <option value={year}>{year}</option>
                })}
            </select>
        </div>
    )
}

export default Filter;
